import React from "react";

function Header() {
  return (
    <header>
      <a href="/">
        <h2>
          Learn
          <img
            src="https://i.stack.imgur.com/zHFFO.png"
            width="110"
            alt="logo"
          ></img>
        </h2>
      </a>
    </header>
  );
}

export default Header;
